import React from "react";
import Footer from "./Footer";
import Captura from "../img/Captura.png";
import { Nav } from "react-bootstrap";

class Home extends React.Component {
  render() {
    return (
      <React.Fragment>
        <div className="d-flex flex-column align-items-center">
          <h3 className="p-3 text-center lh-1">Hola mundo, soy Martín Madridejos, <br></br> desarrollador web apasionado del mundo Front End</h3>
          <img src={Captura} alt="imagen" style={{ width: "200px", borderRadius: "100%" }}></img>
          <h3 className="p-3 text-center lh-1">¡Conóceme más!</h3>

        </div>
        <Card className="text-center">
  <Card.Header>Featured</Card.Header>
  <Card.Body>
    <Card.Title>Special title treatment</Card.Title>
    <Card.Text>
      With supporting text below as a natural lead-in to additional content.
    </Card.Text>
    <Button variant="primary">Go somewhere</Button>
  </Card.Body>
  <Card.Footer className="text-muted">2 days ago</Card.Footer>
</Card>
        <Footer />
      </React.Fragment>
    );
  }
}

export default Home;
